import React from 'react';
import PostCard from '../Components/PostCard';


const Home = () => {
  return (
    <>
      {
        [1, 2, 3, 4, 5, 6, 7, 7, 99, 6, 4, 2].map((itm, idx) => (
          <>
            <PostCard key={idx} />
            <Input placeholder="Basic usage" />
          </>
        ))
      }
    </>
  );
}

export default Home;
